import React from "react";
import {Jumbotron} from "react-bootstrap";

class WelcomeAdmin extends React.Component{

    render() {
        return (

            <Jumbotron className = "bg-light text-dark">
                <h1>Witaj administratorze!</h1>
                <p>
                    Teraz po zalogowaniu możesz:
                    <ol>
                        <li>Zmiana stanu użytkownika:
                            <ul>
                                <li>Bannowanie</li>
                                <li>Akrywowanie</li>
                                <li>Dezaktywowanie</li>
                            </ul>

                        </li>
                        <li>Zmiana typu użytkownika:
                            <ul>
                                <li>Użytkownik</li>
                                <li>Moderator</li>
                                <li>Admin</li>
                            </ul>

                        </li>
                    </ol>
                </p>

            </Jumbotron>

        );
    }
}
export default WelcomeAdmin;
